import React from "react";
import "./App.css";
import { SuperHero } from "./types";
import SuperheroList from "./pages/SuperheroList";

function App() {
  const product: SuperHero[] = [
    { name: "Batman", description: "Batman Lorem Ipsum" },
    { name: "Marvelman", description: "Marvelman Lorem Ipsum" },
    { name: "Spider-Man", description: "Spider-Man Lorem Ipsum" },
    { name: "Superman", description: "Superman Lorem Ipsum" },
  ];

  return (
    <>
      <SuperheroList superheroInfo={product} />
    </>
  );
}

export default App;
